import { Button } from 'react-bootstrap';
import './Header.css';

function Header (){
		console.log("Basic Header");
		return(
		<header>
			<h1>Memory</h1>
            <Button onClick={()=>{window.location = "/"}} bg="logout-button">
                Login
            </Button>
            <Button onClick={()=>{window.location = "/signup"}}>
                Signup
            </Button>
		</header>)
};

export default Header;
